import React from 'react';
import { Row, Col } from 'antd';
const LoginMovie = () => {
	return (
		<Row>
			<Col span={12} offset={6}>
				<h1>hehe</h1>
			</Col>
		</Row>
	);
};

export default LoginMovie;
